import React from 'react';
import './content.scss';

function LeftContent() {
  return(
    <div className="left-content">

    </div>
  )
}

function RightContent() {
  return(
    <div className="right-content">
      <img src='../../assets/home.jpg' alt='image of Steph' />
    </div>
  )
}




function Home() {
  return(
    <div className="container">
      <LeftContent />
      <RightContent />
    </div>
  )
}

export default Home;
